INSERT INTO Products (Name,[Desc],Size,Weight,ChargingTime,ChargingEfficiency,Accessibility,Battery,BatteryCore,Controls,Input,Output,Features,BrandId,CategoryId,Status,ThumnailId,ThumnailUrl) VALUES (N'Baseus Bipow Pro PPBD2-1020',N'Pin sạc dự phòng Polymer 10000mAh Type C PD 20W Baseus Bipow Pro PPBD2-1020 sở hữu gam màu sang trọng, thiết kế đẹp mắt, dung lượng 10.000 mAh, tương thích với nhiều thiết bị, mang đến cho người dùng những trải nghiệm hoàn hảo.', 'Dài 13.2 cm - Rộng 6.2 cm - Dày 1.96 cm', '200 g', '5 - 6 giờ (dùng Adapter 2A)10 - 11 giờ (dùng Adapter 1A)', '0.58', 'Đèn LED báo pin', '10000 mAh', 'Polymer', '1 nút nguồn', 'Type C: 5V - 3A, 9V - 2A', 'USB: 5V - 3A, 9V - 2A, 12V - 1.5AType C: (PD) 5V - 3A, 9V - 2.22A (Max 20 W), 12V - 1.5A', 'Power Delivery Màn hình LED báo hiệu', 10, 2, 1, 'ogq6zizh3ei1w91up9hd', 'https://res.cloudinary.com/dht1ypbn2/image/upload/v1718203209/ogq6zizh3ei1w91up9hd.jpg')
INSERT INTO Products (Name,[Desc],Size,Weight,ChargingTime,ChargingEfficiency,Accessibility,Battery,BatteryCore,Controls,Input,Output,Features,BrandId,CategoryId,Status,ThumnailId,ThumnailUrl) VALUES (N'Baseus Comet PPMD10',N'Pin sạc dự phòng Polymer 10000mAh Type C PD 22.5W Baseus Comet PPMD10 kèm Cáp Lightning và Type C sở hữu thiết kế thanh lịch, chất liệu pin sạc bền bỉ. Bên cạnh đó, sạc dự phòng còn được tích hợp dung lượng pin lớn kèm công nghệ sạc ấn tượng, hứa hẹn không làm cho người dùng phải thất vọng.', 'Dài 12.85 cm - Rộng 7 cm - Dày 2.33 cm', '260g', '5 - 6 giờ (dùng Adapter 2A)10 - 11 giờ (dùng Adapter 1A)', '0.6', 'Đèn LED báo pin', '10001 mAh', 'Li-Polymer', '1 nút nguồn', 'Type C: 5V - 3A, 9V - 2A, 12V - 1.5A', 'USB: 5V - 2.4AType C: 5V - 2.4A, 9V - 2.22A (Max 20W), 12V - 1.5ACáp Type C: 5V - 2.4A, 9V - 2A, 10V - 2.25A (SCP), 12V - 1.5ACáp Lightning: 5V - 2.4A, 9V - 2.22A', 'Power Delivery Màn hình LED báo hiệu', 10, 2, 1, 'djijnaqp0jeldj0qaiwu', 'https://res.cloudinary.com/dht1ypbn2/image/upload/v1718203219/djijnaqp0jeldj0qaiwu.jpg')
